const API_KEY = "d394100d-0f75-4ba6-";



export const getMatches= () => {
    
    const url = `https://api.cricapi.com/v1/matches?apikey= ${API_KEY}`;
    return fetch().then((response) => response.json).catch( (error) => console.log("Error: ", error));
    
};
